import React, { Component } from 'react';
import styled from "styled-components";

const Container = styled.div`
 display: flex;
 flex-direction: column;
 justify-content: center;
 align-items: center;
 margin: 0 auto;
 width: 100%;

`;

const ListCont = styled.div`
  border: 1px solid black;
  margin-top: 150px;
  padding: 100px;
`;

const Title = styled.p`
font-size: 20px;
font-weight: bold;
`;

const CloseBtn = styled.div`
color: red;
margin-bottom: 500px;
`;


const Info = () => {
  return (
    <Container>
      <ListCont>
      <CloseBtn>X</CloseBtn>
        <Title>Total Kasus Covid19 di Indonesia</Title>
        <ul>
          <li>Dikonfirmasi: 170 rb </li>
          <li>Sembuh: 82.236 </li>
          <li>Meninggal: 5.765 </li>
        </ul>
      </ListCont>
    </Container>
  )
}

export default Info
